import React, { useEffect, useState } from "react";
import "./App.css";
import { ConnectButton, Logo } from "web3uikit";
import logo from "./images/Moralis.png";

const App = () => {

  return (
    <>
     <div className="header">
       <div className="logo">
          <img src={logo} alt="logo" height="50px" />
          Sentiment
       </div>
       <ConnectButton />
     </div>
    </>
  );
};

export default App;
